/*Table structure for table `qqgameinfo` */

DROP TABLE IF EXISTS `qqgameinfo`;

CREATE TABLE `qqgameinfo` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id主键',
  `QQAccount` bigint(11) NOT NULL DEFAULT '0' COMMENT 'QQ账号',
  `GameName` varchar(20) NOT NULL DEFAULT '' COMMENT '游戏名称',
  `GameUrl` varchar(20) NOT NULL DEFAULT '' COMMENT '游戏官网地址',
  `GameDetail` varbinary(20) NOT NULL DEFAULT '' COMMENT '注册详情(区服)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `foreignkey` (`QQAccount`),
  CONSTRAINT `foreignkey` FOREIGN KEY (`QQAccount`) REFERENCES `qqaccountinfo` (`QQAccount`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `qqgameinfo` */

/*Table structure for table `qqsecurity` */

DROP TABLE IF EXISTS `qqsecurity`;

CREATE TABLE `qqsecurity` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `qqAccount` bigint(11) NOT NULL DEFAULT '0' COMMENT 'qq账号',
  `password` varchar(15) NOT NULL DEFAULT '' COMMENT '密码',
  `question1` varchar(20) NOT NULL DEFAULT '' COMMENT '密保问题1',
  `question2` varchar(20) NOT NULL DEFAULT '' COMMENT '密保问题2',
  `question3` varchar(20) NOT NULL DEFAULT '' COMMENT '密保问题3',
  `answer1` varchar(20) NOT NULL DEFAULT '' COMMENT '密保答案1',
  `answer2` varchar(20) NOT NULL DEFAULT '' COMMENT '密保答案2',
  `answer3` varchar(20) NOT NULL DEFAULT '' COMMENT '密保答案3',
  `bindTel` bigint(11) NOT NULL DEFAULT '0' COMMENT '绑定手机',
  `createTime` datetime NOT NULL DEFAULT '1970-01-01 00:00:00' COMMENT '创建时间',
  PRIMARY KEY (`id`),
  KEY `foreignkey2` (`qqAccount`),
  CONSTRAINT `foreignkey2` FOREIGN KEY (`qqAccount`) REFERENCES `qqaccountinfo` (`QQAccount`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

